import React from 'react';
import { TextField, Button, Checkbox, FormControlLabel, Box } from '@mui/material';

function CustomSignInForm({ onSubmit }) {
  const handleSubmit = (event) => {
    event.preventDefault();
    const formData = new FormData(event.currentTarget);
    onSubmit(formData);
  };

  return (
    <Box component="form" onSubmit={handleSubmit} noValidate sx={{ mt: 1 }}>
      <TextField
        margin="normal"
        required
        fullWidth
        id="email"
        label="Email Address"
        name="email"
        autoComplete="email"
        autoFocus
      />
      <TextField
        margin="normal"
        required
        fullWidth
        id="FirstName"
        label="PrÃ©nom"
        name="FirstName"
      />
      <TextField
        margin="normal"
        required
        fullWidth
        id="LastName"
        label="Nom"
        name="LastName"
      />
      <TextField
        margin="normal"
        required
        fullWidth
        name="password"
        label="Password"
        type="password"
        id="password"
        autoComplete="current-password"
      />
      <FormControlLabel
        control={<Checkbox value="remember" color="primary" />}
        label="Remember me"
      />
      <Button
        type="submit"
        fullWidth
        variant="contained"
        sx={{ mt: 3, mb: 2 }}
      >
        Sign In
      </Button>
    </Box>
  );
}

export default function CustomSignInPage() {
  const handleSubmit = (formData) => {
    alert(
      `Signing in with credentials: ${formData.get('email')}, ${formData.get('FirstName')}, ${formData.get('LastName')}, ${formData.get('password')}`
    );
  };

  return <CustomSignInForm onSubmit={handleSubmit} />;
}
